import { Container} from 'react-bootstrap';
import { Navbar, Nav } from 'react-bootstrap';
import { FaFacebook, FaTwitter, FaInstagram, FaWhatsapp, FaSnapchat } from 'react-icons/fa';

function Footer() {
  return (
    <footer >
      <Container>
      
        <hr />
        
        <p className="justify-content-center text-center">© {new Date().getFullYear()} Copyright: أكاديمية نور القرءان
        <Nav className='me-auto'>
          
            <Nav.Link href="#"><FaWhatsapp /></Nav.Link>
            <Nav.Link href="#"><FaSnapchat /></Nav.Link>
            <Nav.Link href="#"><FaFacebook /></Nav.Link>
            <Nav.Link href="#"><FaTwitter /></Nav.Link>
            <Nav.Link href="#"><FaInstagram /></Nav.Link>
          </Nav></p>
      </Container>
    </footer>
  );
}

export default Footer;
